import React from 'react';

const TopicTag = (props) => {


    return (

        <div className="topic-tags">

            <div className="tag-icon">{props.tagDetails.icon}</div>
            <div className="tag-name">{props.tagDetails.name}</div>

        </div>


    )


}

export default TopicTag;
